Let's start on a basic statistics program. To get started, we need to include the cmemoir headers. #include <cmemoir/cmemoir.h> using namespace memoir; Now, let's make our main function, where we will read the arguments into a MEMOIR sequence. To start off with, we need to allocate a sequence. Sequences can be allocated with the memoir_allocate_sequence function. The first argument to the function is the type of elements within the sequence and the second is the initial length of the sequence, for example: #include <cmemoir/cmemoir.h> using namespace memoir; int main(int argc, char *argv[]) { collection_ref input = memoir_allocate_sequence(memoir_i32_t, argc - 1);
} Now let's populate the sequence! To write to the sequence, we use the function memoir_index_write(T, v, s, i). T is the shorthand element type, v is the value to write to s[i]. With this, we can update our main function: #include <cmemoir/cmemoir.h>
#include <stdlib.h> using namespace memoir; int main(int argc, char *argv[]) { collection_ref input = memoir_allocate_sequence(memoir_i32_t, argc - 1); for (int i = 0; i < argc - 1; ++i) { memoir_index_write(i32, atoi(argv[i+1]), input, i); }
} Let's go ahead and use the sequence for something now! To do that, we can create a new function to compute the sum of the sequence: int sum(collection_ref input) { int32_t sum = 0; for (int i = 0; i < memoir_size(input); ++i) { sum += memoir_index_read(i32, input, i); } return sum;
} In sum we use two new MEMOIR functions: memoir_index_read and memoir_size. memoir_index_read(T, s, i) reads s[i], which has element type T. memoir_size(s) returns the size of the sequence as a size_t. Now we can call our sum function in main: #include <stdio.h>
...
int main(int argc, char *argv[]) { collection_ref input = memoir_allocate_sequence(memoir_i32_t, argc - 1); for (int i = 0; i < argc - 1; ++i) { memoir_index_write(i32, atoi(argv[i+1]), input, i); } int result = sum(input); printf("sum = %d\n", result); return 0;
}

