Let's extend our statistics program to provide a histogram! First off, we will need to create a new associative array, which can be done with memoir_allocate_assoc_array(K, V), where K is the key rtype and V is the value type: collection_ref hist(collection_ref input) { collection_ref histogram = memoir_allocate_assoc_array(memoir_i32_t, memoir_u32_t);
} Following this, we need to populate it with values from the input sequence. collection_ref hist(collection_ref input) { collection_ref histogram = memoir_allocate_assoc_array(memoir_i32_t, memoir_u32_t); for (int i = 0; i < memoir_size(input); ++i) { int32_t value = memoir_index_read(i32, input, i); if (memoir_assoc_has(histogram, value)) { uint32_t current = memoir_assoc_read(u32, histogram, value); memoir_assoc_write(u32, current + 1, histogram, value); } else { memoir_assoc_insert(histogram, value); memoir_assoc_write(u32, 1, histogram, value); } } return histogram;
} Note that we must explicitly insert keys into the associative array before writing to it, it is undefined behavior to write a value to a key which doesn't exist in the associative array. Now, let's use the new hist function and see how to iterate over it: int main(...) { collection_ref input = ...; { ... } collection_ref histogram = hist(input); collection_ref keys = memoir_assoc_keys(histogram); for (int i = 0; i < memoir_size(keys); ++i) { int32_t key = memoir_index_read(i32, keys, i); uint32_t count = memoir_assoc_read(u32, histogram, key); printf("%d -> %ld\n", key, count); } return 0;
} To iterate over the associative array, we need to collect its keys with the memoir_keys function. memoir_assoc_keys(a) returns a sequence of the keys present in a. Note that their is no guarantee on the order of keys in the resultant.

