So far our pass isn't much to write home about, but it's a great start! Let's kick it up a notch by updating the pass to count the type of MEMOIR instructions in our program. For this, we can use a visitor. Add the following includes to your program: #include <memoir/ir/InstVisitor.hpp>
#include <map> The MEMOIR InstVisitor gives us similar functionality to LLVM's InstVisitor, in fact, anything you can do in an LLVM InstVisitor can be done in MEMOIR's! We can start by definining out visitor class: class MyVisitor : public llvm::memoir::InstVisitor<MyVisitor, void> { // In order for the wrapper to work, we need to declare our parent classes as friends. friend class llvm::memoir::InstVisitor<MyVisitor, void>; friend class llvm::InstVisitor<MyVisitor, void>;
} Great! Now that we have our boilerplate, let's fill it in: class MyVisitor : ... { ... public: // We will store the results of our analysis here: std::map<std::string, uint32_t> instruction_counts; // We _always_ need to implement visitInstruction! void visitInstruction(llvm::Instruction &I) { // Do nothing. return; } // Count all access instructions (read, write, get) together: void visitAccessInst(llvm::memoir::AccessInst &I) { this->instruction_counts["access"]++; return; } // Let's do the same for allocation instructions: void visitAllocInst(llvm::memoir::AllocInst &I) { this->instruction_counts["alloc"]++; return; } // Put everything else into an "other" bucket. // NOTE: since visitAllocInst and visitAccessInst are // implemented, visitMemOIRInst will _never_ be // passed an AllocInst nor an AccessInst. void visitMemOIRInst(llvm::memoir::MemOIRInst &I) { this->instruction_counts["other"]++; return; } Now we can use the visitor in our runOnModule pass: bool runOnModule(llvm::Module &M) override { // Initialize our visitor: MyVisitor visitor; // Analyze the program. for (llvm::Function &F : M) { for (llvm::BasicBlock &BB : F) { for (llvm::Instruction &I : BB) { visitor.visit(I); } } } // Print the results of our visitor: for (const auto &[type, count] : visitor.instruction_counts) { llvm::errs() << type << " -> " << count << "\n"; } // We did not modify the program, so we return false. return false;
} Now this is starting to look like a compiler pass! As an exercise, try adding a couple more counters like InsertInst and RemoveInst!
